import React from 'react'
import { PageWrapper } from '../Constants/Constants'
import styled from 'styled-components';




const Host = () => {

    const sports = [
        "Choose sport",
        "Soccer",
        "Tennis",
        "Basket-Ball",
        "Badminton",
        "Hockey",
        "Dodgeball",
        "Volleyball",
    ]

    const skillLevel = [
        "Choose skill level",
        "Beginner",
        "Intermediate",
        "Advanced"

    ]







    return (

        <PageWrapper>

            <form>
                <input type='text' placeholder='Enter name'></input>
                <select>
                    {sports.map(sport => {
                        return (
                            <option>{sport}</option>
                        )
                    })}
                </select>
                <select>
                    {skillLevel.map(skill => {
                        return (
                            <option>{skill}</option>
                        )
                    })}
                </select>
                {/* <input type='text'></input>
                <input type='text'></input> */}


            </form>
        </PageWrapper>
    )

}

export default Host;
